1. Roll angle (θ):

θ = atan2(Y, X) \* 180 / π

where Y and X are the accelerometer values in g-force units.

2. Pitch angle (ψ):

ψ = atan2(-Z, sqrt(X^2 + Y^2)) \* 180 / π

where Z and X and Y are the accelerometer values in g-force units.

3. Yaw angle (φ):

φ = atan2(Z, X) \* 180 / π

where Z and X are the accelerometer values in g-force units.

Note that these formulae assume that the accelerometer is mounted with its X-axis aligned with the roll axis, Y-axis aligned with the pitch axis, and Z-axis aligned with the yaw axis.

Also, the atan2 function returns the angle in radians, so you need to multiply the result by 180/π to convert it to degrees.

Here's an example code snippet in JavaScript that calculates the angles from Expo Accelerometer values:
```javascript
import { Accelerometer } from 'expo-sensors';

const accelerometer = new Accelerometer({
  updateInterval: 100, // update acceleration every 100 milliseconds
});

accelerometer.addEventListener('data', (data) => {
  const x = data.acceleration.x;
  const y = data.acceleration.y;
  const z = data.acceleration.z;

  const roll = Math.atan2(y, x) * 180 / Math.pi();
  const pitch = Math.atan2(-z, Math.sqrt(x * x + y * y)) * 180 / Math.pi();
  const yaw = Math.atan2(z, x) * 180 / Math.pi();

  console.log(`Roll: ${roll} degrees`);
  console.log(`Pitch: ${pitch} degrees`);
  console.log(`Yaw: ${yaw} degrees`);
});
```
Note that the accelerometer values are in g-force units, so you may need to apply a scaling factor to convert them to actual angles. Also, the angles calculated here are based on the accelerometer's native coordinate system, which may be different from the device's physical orientation."]

